import {Link} from 'react-router-dom'
import './stylesheet.scss'

import MenuIcon from './menuIcon.png'

const Menu = props => {
    const [open, setOpen] = useState(0);

    useEffect(() => {
        setOpen(false);
    })

    return <>
        <div id="Menu">
            <div id="logo">
                <h1>SRSI</h1>
            </div>
            <div id="Menus">
                <img id="MenuButton" alt="Menu Button" src={MenuIcon} width="50px"/>
            </div>
        </div>
        <div id="NavMenu" className={open ? "opened" : "closed"}>
            <Link to="/"> <span className="MenuLink">Pagina PrincipalÄƒ</span> </Link> <br/> <br/>
            <Link to="/despre-noi"> <span className="MenuLink">Despre Noi</span> </Link> <br/> <br/>
            <Link to="/evenimente"> <span className="MenuLink">Evenimente</span> </Link> <br/> <br/>
            <Link to="/articole"> <span className="MenuLink">Articole</span> </Link> <br/> <br/>
            <Link to="/contact"> <span className="MenuLink">Contact</span> </Link> <br/> <br/>
            <Link to="/noutati"> <span className="MenuLink">NoutÄƒÈ›i</span> </Link> <br/> <br/>
        </div>
    </>;
};

export default Menu;
